import cls from './Header.module.scss'
import {useLocation} from "react-router-dom";

const Header = () => {

    const location = useLocation()

    return (
        <div className={cls.header} >
            <div className="container">
                <div className={cls.inner}>

                </div>
            </div>
        </div>
    );
};

export default Header;
